        <div>
            <div>
                <h5>
                  PGR Prediction:
                </h5>
              </div>
              <br></br>
              <br></br>
              <div>
                <h5>
                  PGR Final Prediction:
                </h5>
              </div>
             <br></br>
             <br></br>
        </div>
    );
}

export default PGRprdiction;
